import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import FilterCountry from "../components/FilterCountry";
import Pagination from "../components/Pagination";
import "../styles/AllCountries.css";

const AllCountries = () => {
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState("");
  const [allCountries, setAllCountries] = useState([]);
  const [currentCountries, setCurrentCountries] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [countriesPerPage] = useState(10);
  const [regionFilter, setRegionFilter] = useState("");
  const [nameFilter, setNameFilter] = useState("");

  useEffect(() => {
    setIsLoading(true);
    fetch("https://restcountries.com/v2/all")
      .then((response) => response.json())
      .then((data) => {
        setIsLoading(false);
        setAllCountries(data);
        setCurrentCountries(data.slice(0, 10));
      })
      .catch((error) => {
        setIsLoading(false);
        setError(error.message);
      });
  }, []);

  const handleRegionChange = (region) => {
    setRegionFilter(region);
    setNameFilter("");
    setCurrentPage(1);
    const filteredCountries = allCountries.filter(
      (country) => country.region === region
    );
    setCurrentCountries(filteredCountries.slice(0, 10));
  };

  const handlePageChange = (page) => {
    setCurrentPage(page);
    const startIndex = (page - 1) * countriesPerPage;
    const endIndex = startIndex + countriesPerPage;
    setCurrentCountries(filteredByNameAndRegion.slice(startIndex, endIndex));
  };

  const handlerBuscadorChange = (event) => {
    const input = event.target.value.toLowerCase();
    setNameFilter(input);
    setRegionFilter("");
    setCurrentPage(1);
    const filteredCountries = allCountries.filter((country) =>
      country.name.toLowerCase().includes(input)
    );
    setCurrentCountries(filteredCountries.slice(0, 10));
  };

  const filteredByNameAndRegion = allCountries.filter(
    (country) =>
      country.region.includes(regionFilter) &&
      country.name.toLowerCase().includes(nameFilter)
  );

  return (
    <div className="all__Country__wrapper">
      <div className="country__top">
        <div className="search-input-container">
          <Link to="/" className="home">
            <button>
              <p> -=Home=-</p>
            </button>
          </Link>
        </div>
        <div className="search">
          <input
            placeholder="Escribe aquÃ­ el paÃ­sðŸŒ"
            type="search"
            onChange={handlerBuscadorChange}
          />
        </div>
        <div className="filter">
          <FilterCountry onSelect={handleRegionChange} />
        </div>
      </div>
      <div className="country__bottom">
        {isLoading && !error && <h4>Loading.........</h4>}
        {error && !isLoading && <h4>{error}</h4>}

        {currentCountries?.map((country, index) => (
          <div className="country__card" key={index}>
            <div className="country__img">
              <img src={country.flag} alt="png" />
            </div>
            <div className="country__data">
              <h3>{country.name}</h3>
              <h6>Population: {country.population}</h6>
              <h6>Region: {country.region}</h6>
                        <h6>Capital: {country.capital}</h6>
                    </div>
                </div>
            ))}
            {filteredByNameAndRegion.length > 10 && (
                <Pagination
                    data={filteredByNameAndRegion}
                    itemsPerPage={countriesPerPage}
                    onPageChange={handlePageChange}
                />
            )}
        </div>
    </div>
);
            }

export default AllCountries;
